DROP TABLE IF EXISTS "appointments";
DROP TABLE IF EXISTS "test_availabilities";
DROP TABLE IF EXISTS "availabilities";
DROP TABLE IF EXISTS "providers";
DROP TABLE IF EXISTS "user";

CREATE TABLE "user" (
    "id" SERIAL PRIMARY KEY,
    "username" VARCHAR (80) UNIQUE NOT NULL,
    "password" VARCHAR (1000) NOT NULL,
    "role" VARCHAR (200),
    "first_name" VARCHAR (1000),
    "last_name" VARCHAR (1000),
    "phone" INTEGER,
    "address" VARCHAR (1000),
    "city" VARCHAR (1000),
    "state" VARCHAR (4),
    "zip_code" INTEGER 
);

-------------------------------------------------------------

CREATE TABLE "providers" (
    "id" SERIAL PRIMARY KEY,
    "first_name" VARCHAR (1000) NOT NULL,
    "last_name" VARCHAR (1000) NOT NULL,
    "specialty" VARCHAR (1000) NOT NULL,
    "telemedicine" BOOLEAN,
    "city" VARCHAR (1000) NOT NULL,
    "health_system" VARCHAR (1000) NOT NULL,
    "address" VARCHAR (1000) NOT NULL,
    "state" VARCHAR (4) NOT NULL,
    "zip_code" VARCHAR (1000) NOT NULL
);

-------------------------------------------------------------

CREATE TABLE "appointments" (
    "id" SERIAL PRIMARY KEY,
    "user_id"  INT REFERENCES "user" (id) ON DELETE CASCADE NOT NULL,
    "start_time" TIMESTAMP,
    "end_time" TIMESTAMP,
    "provider_id"  INT REFERENCES "providers" (id) ON DELETE CASCADE NOT NULL,
    "description" VARCHAR (1000) NOT NULL
);

-------------------------------------------------------------

CREATE TABLE availabilities (
    id SERIAL PRIMARY KEY,
    start_time timestamp without time zone,
    provider_id integer NOT NULL REFERENCES providers(id) ON DELETE CASCADE,
    end_time timestamp without time zone,
    day integer,
    "8:00" boolean,
    "8:30" boolean,
    "9:00" boolean,
    "9:30" boolean,
    "10:00" boolean,
    "10:30" boolean,
    "11:00" boolean,
    "11:30" boolean,
    "12:00" boolean,
    "12:30" boolean,
    "1:00" boolean,
    "1:30" boolean,
    "2:00" boolean,
    "2:30" boolean,
    "3:00" boolean,
    "3:30" boolean,
    "4:00" boolean,
    "4:30" boolean,
    test integer
);

CREATE TABLE "test_availabilities" (
    "id" integer GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    "start_time" text,
    "end_time" text,
    "provider_id" integer REFERENCES "providers" (id) ON DELETE CASCADE,
    "day" integer
);


